export enum TableStatus {
  CANCELED = "Отклонен",
  AFFIRM = "На утверждении",
  DONE = "Выполнен",
  PROCESSING = "В процессе",
}

export enum TableShipping {
  DELIVERING_JPOST = "Доставка JPost",
  DELIVERING = "Доставка",
  PICKUP = "Самовывоз",
}
export enum ColumnsName {
  NUMBER_OF_ORDER = "№ заказа",
  SHIPPING_DATE = "Дата поступления",
  ORDER_STATUS = "Статус заказа",
  CITY = "Город покупателя",
  CUSTOMER = "Покупатель",
  PHONE_NUMBER = "Телефон",
  TYPE_OF_DELIVERY = "Тип доставки",
}
